INSERT INTO `help_center_content` (`id`, `title`, `slug`, `content`, `status`, `created_at`, `updated_at`, `category_id`) VALUES
(2, 'Comment ça marche ?', 'comment-ca-marche', '<h1>Votre arriv&eacute;e &eacute;tape par &eacute;tape</h1>\n\n<p>&nbsp;</p>\n\n<p>1. R&eacute;servez en ligne votre parking Parkme puis garez votre v&eacute;hicule sur les emplacements jaunes.&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><img alt=\"\" src=\"http://parkme.fr/public/assets/images/1-commentçamarchefaq.png\" style=\"height:250px; width:333px\" /></p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>2. Une navette Parkme viendra vous accueillir &agrave; votre v&eacute;hicule, laisser les clefs de votre v&eacute;hicule &agrave; l&#39;agent Parkme puis montez dans la navette.&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><img alt=\"\" src=\"http://parkme.fr/public/assets/images/2-commentçamarchefaq.png\" style=\"height:201px; width:333px\" /></p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>3. La navette Parkme vous transporte &agrave; l&#39;a&eacute;roport s&eacute;lectionn&eacute; de votre r&eacute;servation pour un court trajet (~2min).&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><img alt=\"\" src=\"http://parkme.fr/public/assets/images/3-commentçamarchefaq.png\" style=\"height:443px; width:333px\" /></p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>4. Apr&egrave;s vous avoir d&eacute;pos&eacute;, votre v&eacute;hicule est pris en photo dans chaque angle de vue dans l&#39;espace de stationnement parkme.&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><img alt=\"\" src=\"http://parkme.fr/public/assets/images/5-commentçamarchefaq.png\" style=\"height:332px; width:333px\" /></p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<h1>Votre retour&nbsp;&eacute;tape par &eacute;tape</h1>\n\n<p>1. &Agrave; votre retour, contactez Parkme pour annoncer votre retour &agrave; l&rsquo;a&eacute;roport, des instructions vous seront alors donn&eacute;es concernant le lieu de votre prise en charge pour votre retour &agrave; votre v&eacute;hicule.&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><img alt=\"\" src=\"http://parkme.fr/public/assets/images/4-commentçamarchefaq.png\" style=\"height:272px; width:333px\" /></p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>FIN. R&eacute;cup&eacute;rez votre v&eacute;hicule et laissez un avis sur Google afin de savoir ce que vous avez pens&eacute; de Parkme et nous permettre d&#39;am&eacute;liorer le service.&nbsp;</p>\n\n<p>Pour plus d&#39;informations, visitez le centre d&#39;aide ou contactez le support Parkme.</p>\n\n<p>&nbsp;</p>', 1, '2021-06-16 15:31:00', '2021-08-24 18:45:34', 1),
(3, 'Mon véhicule est-il sécurisé à Parkme ?', 'mon-vehicule-est-il-securise-a-parkme', '<h1>La s&eacute;curit&eacute; &agrave; parkme</h1>\n\n<p>&nbsp;</p>\n\n<p>Tous les parkings Parkme sont&nbsp;&eacute;quip&eacute;s de <strong>syst&egrave;mes de vid&eacute;osurveillance</strong> et de <strong>cl&ocirc;ture.</strong></p>\n\n<p>&nbsp;</p>\n\n<p>Chaque v&eacute;hicule entrant &agrave; parkme est pris en photo dans chaque angle de vue, en cas de probl&egrave;me suite au retrait de votre v&eacute;hicule dans un des espaces de stationnement Parkme, veuillez contacter le support :</p>\n\n<p>&nbsp;</p>\n\n<ul>\n	<li>\n	<p>T&eacute;l&eacute;phone: 05 31 60 25 25</p>\n	</li>\n	<li>\n	<p>Adresse e-mail: contact@parkme.fr</p>\n	</li>\n</ul>', 1, '2021-06-16 15:31:22', '2021-07-13 21:52:30', 1),
(5, 'Est-il possible de modifier ma réservation ?', 'est-il-possible-de-modifier-ma-reservation', '<h1>Oui</h1>\n\n<p>&nbsp;</p>\n\n<p>Votre r&eacute;servation peut &ecirc;tre modifi&eacute;e gratuitement depuis la page <a href=\"http://parkme.fr/my-reservations\">&laquo;mes r&eacute;servations&raquo;.</a></p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<h1>Tutoriel</h1>\n\n<p>&nbsp;</p>\n\n<p>1. Rendez-vous sur la page <a href=\"http://parkme.fr/my-reservations\">&ldquo;mes r&eacute;servations&rdquo;</a>.</p>\n\n<p>2. Cliquez sur &ldquo;voir&rdquo; pour faire appara&icirc;tre les d&eacute;tails de votre r&eacute;servation.</p>\n\n<p>3. Modifier gr&acirc;ce au bouton situ&eacute; en bas des d&eacute;tails de votre r&eacute;servation.</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>', 1, '2021-07-07 06:57:34', '2021-08-28 05:14:44', 3),
(7, 'Comment modifier ma réservation ?', 'comment-modifier-ma-reservation', '<h1>Modifier une r&eacute;servation</h1>\n\n<p>&nbsp;</p>\n\n<p>Votre r&eacute;servation peut &ecirc;tre modifi&eacute;e gratuitement depuis la page <a href=\"http://parkme.fr/my-reservations\">&laquo;mes r&eacute;servations&raquo;.</a></p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<h1>Tutoriel</h1>\n\n<p>&nbsp;</p>\n\n<p>1. Rendez-vous sur la page <a href=\"http://parkme.fr/my-reservations\">&ldquo;mes r&eacute;servations&rdquo;</a>.</p>\n\n<p>2. Cliquez sur &ldquo;voir&rdquo; pour faire appara&icirc;tre les d&eacute;tails de votre r&eacute;servation.</p>\n\n<p>3. Modifier gr&acirc;ce au bouton situ&eacute; en bas des d&eacute;tails de votre r&eacute;servation.</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>', 1, '2021-07-07 07:33:18', '2021-08-28 05:15:00', 3),
(8, 'Est-il possible d’annuler ma réservation ?', 'est-il-possible-dannuler-ma-reservation', '<h1>Oui</h1>\n\n<p>&nbsp;</p>\n\n<p>Votre r&eacute;servation peut &ecirc;tre annul&eacute;e gratuitement depuis la page <a href=\"http://parkme.fr/my-reservations\">&laquo;mes r&eacute;servations&raquo;.</a></p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<h1>Tutoriel</h1>\n\n<p>&nbsp;</p>\n\n<p>1. Rendez-vous sur la page <a href=\"http://parkme.fr/my-reservations\">&ldquo;mes r&eacute;servations&rdquo;</a>.</p>\n\n<p>2. Cliquez sur &ldquo;voir&rdquo; pour faire appara&icirc;tre les d&eacute;tails de votre r&eacute;servation.</p>\n\n<p>3. Annuler gr&acirc;ce au bouton situ&eacute; en bas des d&eacute;tails de votre r&eacute;servation.</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>', 1, '2021-07-07 07:39:16', '2021-08-28 05:15:11', 4),
(9, 'Comment annuler ma réservation ?', 'comment-annuler-ma-reservation', '<h1>Annuler une r&eacute;servation</h1>\n\n<p>&nbsp;</p>\n\n<p>Votre r&eacute;servation peut &ecirc;tre annul&eacute;e gratuitement depuis la page <a href=\"http://parkme.fr/my-reservations\">&laquo;mes r&eacute;servations&raquo;.</a></p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<h1>Tutoriel</h1>\n\n<p>&nbsp;</p>\n\n<p>1. Rendez-vous sur la page <a href=\"http://parkme.fr/my-reservations\">&ldquo;mes r&eacute;servations&rdquo;</a>.</p>\n\n<p>2. Cliquez sur &ldquo;voir&rdquo; pour faire appara&icirc;tre les d&eacute;tails de votre r&eacute;servation.</p>\n\n<p>3. Annuler gr&acirc;ce au bouton situ&eacute; en bas des d&eacute;tails de votre r&eacute;servation.</p>\n\n<p>&nbsp;</p>', 1, '2021-07-07 07:43:26', '2021-08-28 05:15:26', 4),
(10, 'Le lavage', 'le-lavage', '<h1>Lavage ext&eacute;rieur</h1>\n\n<p>&nbsp;</p>\n\n<p>S&eacute;lectionner ce service suppl&eacute;mentaire dans votre r&eacute;servation pour retrouver <strong>l&rsquo;ext&eacute;rieur</strong> de votre v&eacute;hicule lav&eacute; <ins>(</ins><ins>15&euro;)</ins></p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<h1>Lavage int&eacute;rieur</h1>\n\n<p>&nbsp;</p>\n\n<p>S&eacute;lectionner ce service suppl&eacute;mentaire dans votre r&eacute;servation pour retrouver <strong>l&rsquo;int&eacute;rieur</strong> de votre v&eacute;hicule lav&eacute; <ins>(</ins><ins>40&euro;)</ins></p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<h1>Lavage complet</h1>\n\n<p>&nbsp;</p>\n\n<p>S&eacute;lectionner ce service suppl&eacute;mentaire dans votre r&eacute;servation pour retrouver <strong>l&rsquo;int&eacute;rieur</strong> et <strong>l&rsquo;ext&eacute;rieur</strong> de votre v&eacute;hicule lav&eacute; <ins>(</ins><ins>50&euro;)</ins></p>', 1, '2021-07-07 07:46:32', '2021-08-28 05:17:02', 6),
(11, 'Quelle méthode de paiement acceptez-vous ?', 'quelle-methode-de-paiement-acceptez-vous', '<h1>Carte Bancaire</h1>\n\n<p>&nbsp;</p>\n\n<p>La carte bancaire est le moyen unique de paiement pour r&eacute;server.</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>', 1, '2021-07-07 07:55:21', '2021-07-13 21:57:19', 7),
(12, 'Mon paiement à-t-il été effectué avec succès ?', 'mon-paiement-a-t-il-ete-effectue-avec-succes', '<h1>E-mail de confirmation</h1>\n\n<p>&nbsp;</p>\n\n<p>Vous recevrez un e-mail de confirmation sur l&rsquo;e-mail de contact indiqu&eacute; dans votre r&eacute;servation.</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<h1>Page &laquo;mes r&eacute;servations&raquo;</h1>\n\n<p>&nbsp;</p>\n\n<p>Rendez-vous sur la page <a href=\"http://parkme.fr/my-reservations\">&laquo;mes r&eacute;servations&raquo;</a>. Vous pouvez depuis cette page ajouter votre num&eacute;ro de r&eacute;servation et la consulter.</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>', 1, '2021-07-07 07:57:32', '2021-07-13 21:57:24', 7),
(13, 'Mes données de paiement sont-elles sécurisées ?', 'mes-donnees-de-paiement-sont-elles-securisees', '<h1>Oui</h1>\n\n<p>&nbsp;</p>\n\n<p>Parkme utilise la plate-forme de paiement Stripe, toutes les donn&eacute;es de paiement sont crypt&eacute;es et non conserv&eacute;es</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>', 1, '2021-07-07 08:01:21', '2021-07-13 21:57:29', 7),
(14, 'Comment créer un compte ?', 'comment-creer-un-compte', '<h1>Page &laquo;Mon compte&raquo;</h1>\n\n<p>&nbsp;</p>\n\n<p>Vous pouvez cr&eacute;er un compte depuis la page: <a href=\"http://parkme.fr/my-account\">&laquo;Mon compte&raquo;</a>.</p>\n\n<p>Depuis votre compte vous pouvez modifier, annuler vos r&eacute;servations, ajouter vos v&eacute;hicules.</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>', 1, '2021-07-07 08:06:21', '2021-08-11 05:13:08', 10),
(15, 'Comment modifier mes informations personnelles ?', 'comment-modifier-mes-informations-personnelles', '<h1>Page &laquo;Informations personnelles&raquo;</h1>\n\n<p>&nbsp;</p>\n\n<p>Vous pouvez modifier vos informations depuis la page: <a href=\"http://parkme.fr/my-account\">&laquo;Informations personnelles&raquo;</a>.</p>\n\n<p>Pr&eacute;nom, nom, num&eacute;ro de t&eacute;l&eacute;phone, mot de passe sont les informations pouvant &ecirc;tre modifi&eacute;s.</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>', 1, '2021-07-07 08:09:47', '2021-08-11 05:12:48', 10),
(16, 'Comment modifier mon mot de passe ?', 'comment-modifier-mon-mot-de-passe', '<h1>Page &laquo;Informations personnelles&raquo;</h1>\n\n<p>&nbsp;</p>\n\n<p>Vous pouvez modifier vos informations depuis la page: <a href=\"http://parkme.fr/my-account\">&laquo;Informations personnelles&raquo;</a>.</p>\n\n<p>Mettez &agrave; jour votre mot de passe pour vos prochaines connexions.</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>', 1, '2021-07-07 08:10:13', '2021-08-11 05:12:30', 10),
(17, 'Nous contacter ?', 'nous-contacter', '<h1>Support</h1>\n\n<p>&nbsp;</p>\n\n<p>Le support Parkme est &agrave; votre disposition&nbsp;:</p>\n\n<p>&nbsp;</p>\n\n<ul>\n	<li>\n	<p>T&eacute;l&eacute;phone: 05 31 60 25 25&nbsp; &nbsp;(05:00 - 23:00)</p>\n	</li>\n	<li>\n	<p>Adresse e-mail: contact@parkme.fr&nbsp;</p>\n	</li>\n</ul>', 1, '2021-07-07 08:13:49', '2021-07-13 21:57:48', 8),
(18, 'Comment réserver ?', 'comment-reserver', '<h1>Site internet</h1>\n\n<p>&nbsp;</p>\n\n<p>Pour r&eacute;server votre place de parking Parkme, la r&eacute;servation doit &ecirc;tre r&eacute;alis&eacute;e depuis le site internet <a href=\"http://parkme.fr\">&laquo;parkme.fr&raquo;</a>.</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>', 1, '2021-07-07 08:19:35', '2021-08-11 04:54:13', 2),
(19, 'Qu’est-ce qui est inclus dans une réservation ?', 'quest-ce-qui-est-inclus-dans-une-reservation', '<h1>Parkme</h1>\n\n<p>&nbsp;</p>\n\n<p>Votre r&eacute;servation inclut le parking: &laquo;Parkme&raquo;.</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<h1>Navette</h1>\n\n<p>&nbsp;</p>\n\n<p>La navette parkme est incluse dans l&rsquo;aller et votre retour, le trajet dure environ 2 minutes.</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<h1>Modification et annulation gratuite</h1>\n\n<p>&nbsp;</p>\n\n<p>Votre r&eacute;servation peut &ecirc;tre modifi&eacute;e et annul&eacute;e gratuitement depuis la page <a href=\"http://parkme.fr/my-reservations\">&laquo;mes r&eacute;servations&raquo;.</a></p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<h1>Support</h1>\n\n<p>&nbsp;</p>\n\n<p>Le support Parkme est &agrave; votre disposition de 05:00 &agrave; 23:00 par t&eacute;l&eacute;phone (05 31 60 25 25) ou par mail (contact@parkme.fr)</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>', 1, '2021-07-07 08:19:35', '2021-08-11 04:55:31', 2),
(20, 'Combien ça coûte ?', 'combien-ca-coute', '<h1>Prix</h1>\n\n<p>&nbsp;</p>\n\n<p>Le premier jour de parking est &agrave; <strong>14,99&euro;</strong>, Chaque jour suppl&eacute;mentaire co&ucirc;te <strong>5&euro;</strong>.</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>', 1, '2021-07-07 08:19:35', '2021-07-13 21:58:04', 2),
(21, 'Combien de temps j’ai pour réserver avant mon arrivée au parking ?', 'combien-de-temps-jai-pour-reserver-avant-mon-arrivee-au-parking', '<h1>8h maximum avant votre arriv&eacute;e</h1>\n\n<p>&nbsp;</p>\n\n<p>Pour pr&eacute;parer votre arriv&eacute;e, votre r&eacute;servation doit &ecirc;tre r&eacute;alis&eacute;e <strong>jusqu&rsquo;&agrave; maximum 8h</strong>&nbsp;avant votre stationnement &agrave; Parkme.</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>', 1, '2021-07-07 08:20:02', '2021-08-11 04:58:42', 2),
(22, 'Modifier ou annuler ma réservation, possible ?', 'modifier-ou-annuler-ma-reservation-possible', '<h1>Oui</h1>\n\n<p>&nbsp;</p>\n\n<p>Votre r&eacute;servation peut &ecirc;tre modifi&eacute;e et annul&eacute;e gratuitement depuis la page <a href=\"http://parkme.fr/my-reservations\">&laquo;mes r&eacute;servations&raquo;</a>.</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>', 1, '2021-07-07 08:20:02', '2021-07-13 21:58:13', 2),
(24, 'La navette Parkme est-elle incluse dans ma réservation ?', 'la-navette-parkme-est-elle-incluse-dans-ma-reservation', '<h1>Oui</h1>\n\n<p>&nbsp;</p>\n\n<p>La navette Parkme est incluse dans votre r&eacute;servation, nous vous d&eacute;poserons et viendrons vous chercher &agrave; l&rsquo;A&eacute;roport de votre r&eacute;servation.</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>', 1, '2021-07-07 08:31:28', '2021-07-13 21:58:17', 5),
(25, 'Combien de temps dure le trajet en navette ?', 'combien-de-temps-dure-le-trajet-en-navette', '<h1>2 min</h1>\n\n<p>&nbsp;</p>\n\n<p>Le trajet de la navette Parkme vers l&rsquo;A&eacute;roport de votre r&eacute;servation est d&#39;environ&nbsp;<strong>2 min.</strong></p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>', 1, '2021-07-07 08:31:28', '2021-08-11 05:00:40', 5),
(26, 'Adresse', 'adresse', '<h1>Localisation</h1>\n\n<p>&nbsp;</p>\n\n<p><strong>PARKME: A&eacute;roport Toulouse-Blagnac (TLS)</strong></p>\n\n<p>32 rue raymond grimaud, 31700 Blagnac.</p>\n\n<p>&nbsp;</p>\n\n<p><img alt=\"\" src=\"https://parkme.fr/public/assets/images/D-Localisationpic.png\" style=\"height:253px; width:330px\" /></p>', 1, '2021-07-07 08:36:57', '2021-08-24 18:46:08', 9),
(28, 'Qui sommes-nous ?', 'qui-sommes-nous', '<h1>Parkme</h1>\n\n<p>&nbsp;</p>\n\n<p>Parkme est un service de parking a&eacute;roport mettant &agrave; disposition des espaces de stationnement proches des a&eacute;roports, elle permet aux voyageurs de pouvoir r&eacute;server une place de parking quand ils le souhaitent, et d&#39;&ecirc;tre garanti d&#39;avoir une place avant leur voyage.</p>\n\n<p>&nbsp;</p>\n\n<p>Chaque r&eacute;servation Parkme est enti&egrave;rement flexible permettant &agrave; l&#39;utilisateur de modifier ou d&#39;annuler sa r&eacute;servation &agrave; n&#39;importe quel moment.</p>\n\n<p>&nbsp;</p>\n\n<p>Le premier jour de parking est &agrave; 14,99&euro; puis 5&euro;/jour.</p>\n\n<p>&nbsp;</p>', 1, '2021-08-11 05:32:54', '2021-08-11 05:39:49', 1);
